import React, { useState, useEffect } from "react";

export default function Capture({ currentUser, onAddAbsensi }) {
  const [status, setStatus] = useState("");
  const [keterangan, setKeterangan] = useState("");
  const [foto, setFoto] = useState("");
  const [location, setLocation] = useState(null);
  const [error, setError] = useState(null);

  // Minta lokasi saat component mount
  useEffect(() => {
    if (!navigator.geolocation) {
      setError("Geolocation tidak didukung browser Anda");
      return;
    }

    navigator.geolocation.getCurrentPosition(
      (position) => {
        setLocation({
          latitude: position.coords.latitude,
          longitude: position.coords.longitude,
        });
      },
      (err) => {
        setError("Harap aktifkan lokasi untuk capture absensi");
      }
    );
  }, []);

  const handleFotoChange = (e) => {
    const file = e.target.files[0];
    if (!file) return;

    const reader = new FileReader();
    reader.onloadend = () => setFoto(reader.result);
    reader.readAsDataURL(file);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!status) return alert("Status wajib diisi");
    if (!location) return alert("Lokasi belum tersedia");

    await onAddAbsensi({
      status,
      keterangan,
      foto,
      latitude: location.latitude,
      longitude: location.longitude,
    });

    setStatus("");
    setKeterangan("");
    setFoto("");
  };

  if (error) {
    return (
      <div style={{ padding: "20px" }}>
        <h2>Error</h2>
        <p>{error}</p>
      </div>
    );
  }

  if (!location) {
    return (
      <div style={{ padding: "20px" }}>
        <p>Meminta izin lokasi...</p>
      </div>
    );
  }

  return (
    <div style={{ padding: "20px" }}>
      <h2>Absen {currentUser?.name || "User"}</h2>
      <form onSubmit={handleSubmit}>
        <label>Status:</label>
        <select value={status} onChange={(e) => setStatus(e.target.value)} required>
          <option value="">Pilih status</option>
          <option value="hadir">Hadir</option>
          <option value="izin">Izin</option>
          <option value="sakit">Sakit</option>
        </select>

        <label>Keterangan:</label>
        <input
          type="text"
          value={keterangan}
          onChange={(e) => setKeterangan(e.target.value)}
          placeholder="Keterangan (opsional)"
        />

        <label>Foto (opsional):</label>
        <input type="file" accept="image/*" onChange={handleFotoChange} />

        <button type="submit" style={{ marginTop: "10px" }}>Kirim Absensi</button>
      </form>

      <div style={{ marginTop: "10px" }}>
        <p>Lokasi Anda:</p>
        <p>Latitude: {location.latitude}</p>
        <p>Longitude: {location.longitude}</p>
      </div>

      {foto && (
        <div style={{ marginTop: "10px" }}>
          <p>Preview Foto:</p>
          <img src={foto} alt="Preview" style={{ width: "100%" }} />
        </div>
      )}
    </div>
  );
}
